INSERT INTO `flashnews` (`id`, `cat_id`, `title`, `short_descr`, `descr`, `image_path`, `date_time`, `created_at`, `created_by`, `updated_at`, `updated_by`, `status`, `state_id`, `district_id`, `taluk_id`, `notify`) VALUES
(1, 5, 'Medical Kit', '', 'Medical Kit', '', '2021-08-20 13:37:00', '0000-00-00 00:00:00', 0, '2021-08-05 20:07:56', 1, 1, 0, 0, 0, 0),
(2, 5, 'news', '', '<p>news</p>', 'flash_news/flashnews1.png', '2021-08-12 12:04:00', '2021-08-05 20:03:18', 1, '2021-08-05 20:06:18', 1, 1, 0, 0, 0, 0),
(3, 1, 'Lifeonplus', '', '<p>Lifeonplus</p>', 'flash_news/flashnews2.png', '2021-08-12 12:04:00', '2021-08-25 11:49:42', 1, '2021-08-31 10:14:22', 1, -1, 11, 1, 4, 1),
(4, 1, 'Mixed reality opens new ways for medical education', '', '<p>Augmented, virtual, and mixed reality are all technologies opening new worlds for the human senses. While the difference between these technologies might seem arbitrary at first, it greatly determines how they could be used in healthcare.&nbsp;<strong>While AR lets users see the real world and projects digital information onto the existing environment, VR shuts out everything else completely and provides an entire simulation, and mixed reality is able to interact with the world while projecting information into it</strong>.&nbsp;<strong>Thus,&nbsp;</strong><a href="https://medicalfuturist.com/top-9-augmented-reality-companies-healthcare/"><strong>AR can be used by surgeons</strong></a><strong>&nbsp;for projecting potentially life-saving information into their eyesight during operations,&nbsp;</strong><a href="https://medicalfuturist.com/5-ways-medical-vr-is-changing-healthcare/"><strong>VR can be used in psychiatry to treat phobias efficiently</strong></a><strong>, and mixed reality is able to bring revolutionary novelties to medical education, or pre-operative surgical planning, among others.</strong></p>\r\n<p>For example, the&nbsp;<a href="https://www.microsoft.com/hu-hu/hololens">Microsoft HoloLens</a>&nbsp;opens up radically new ways for medical education as it is able to project the human body in its full size in front of med students. Thus, the organs, veins or bones will be visible accurately in 3D, and future medical professionals will be able to analyze their shape, remember their characteristics more vividly than it is possible when studying from a book. There are already some universities who plan to introduce the new technology:&nbsp;<a href="https://consultqd.clevelandclinic.org/new-health-education-campus-offers-immersive-medical-training/">Case Western opened its new health education campus in collaboration with the Cleveland Clinic in 2019</a>, where students study anatomy from virtual reality rather than cadavers.</p>', 'flash_news/flashnews3.png', '2021-08-26 17:15:00', '2021-08-31 10:17:53', 1, '0000-00-00 00:00:00', 0, 1, 11, 0, 0, 1),
(5, 2, 'Abdominal Pain', '', '<p>Pain in abdomen can be of various intensities and nature. It can be:</p>\r\n<ul>\r\n<li>Sharp, stabbing cramp like pain</li>\r\n<li>Brief pain that may come or go</li>\r\n<li>Pain associated with vomiting</li>\r\n</ul>\r\n<p><strong>Reference:&nbsp;</strong><a href="http://www.nhs.uk/conditions/stomach-ache-abdominal-pain/Pages/Introduction.aspx">www.nhs.uk</a></p>', 'flash_news/flashnews.jpeg', '2021-08-31 12:30:00', '2021-08-31 12:06:40', 1, '2021-08-31 16:02:31', 1, 1, 11, 31, 174, 1),
(6, 1, 'TEST FlaLSH NEWS', '', '<p>TEST FlaLSH NEWS</p>', 'flash_news/flashnews1.pdf', '2021-08-31 14:20:00', '2021-08-31 14:24:28', 1, '2021-08-31 14:26:01', 1, 1, 11, 1, 4, 1),
(7, 2, 'Health info', '', '<p>Health info get. a free health check up</p>', 'flash_news/flashnews2.pdf', '2021-09-25 13:36:00', '2021-08-31 14:27:58', 1, '2021-09-25 13:35:03', 1, 1, 11, 1, 4, 1),
