(14, 1, 'Lifeonplus- Launching New Medical &amp; Digital Health Technology', '', '<p>Lifeonplus Launching World\'s Most Advanced Medical &amp; Digital Health Technology In India.</p>', 'flash_news/flashnews.pdf', '2022-01-07 21:35:00', '2022-01-07 21:32:57', 1, '0000-00-00 00:00:00', 0, 1, 11, 1, 4, 1),
(15, 1, 'Greetings from lifeonplus! Thank you for your interest in lifeonplus.', '', '<p><strong>Dear Member,</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Greetings from lifeonplus!&nbsp;Thank you for your interest in lifeonplus.</p>\r\n<p>&nbsp;</p>\r\n<p>Lifeonplus provides the complete healthcare echo system.</p>\r\n<p>We provide world&rsquo;s most advanced medical &amp; digital health technological products &amp; services.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>We provide the following to our customer:</strong></p>\r\n<ol>\r\n<li>Products &amp; Services</li>\r\n<li>Global Digital Health Smart Card</li>\r\n<li>Diagnostics Services</li>\r\n<li>Express Medical Test</li>\r\n<li>Tele Medicine application</li>\r\n<li>Medical Devices</li>\r\n<li>Food Supplements</li>\r\n<li>Medicines</li>\r\n<li>Life savings products</li>\r\n<li>Wearable Technological Products &amp; Services</li>\r\n<li>Digital Health Studio</li>\r\n<li>Covid -19 Products &amp; Services</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li><strong>Business Opportunities:</strong></li>\r\n<li><strong>Channel Partners </strong></li>\r\n<li>State C&amp;F</li>\r\n<li>District Distributor</li>\r\n<li>Taluka Dealer</li>\r\n<li>Retailer (Any Individual)</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li><strong>Major Accounts </strong></li>\r\n<li>Corporates</li>\r\n<li>Industries</li>\r\n<li>Institutions</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li><strong>Medical Fraternity</strong></li>\r\n<li>Hospitals</li>\r\n<li>Labs</li>\r\n<li>Clinics</li>\r\n<li>Medical Shops</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>We will soon contact you to understand your requirement in details.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Warm Regards,</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Team Lifeonplus</strong></p>\r\n<p>&nbsp;</p>\r\n<p>info@lifeonplus.com</p>\r\n<p><a href="http://www.lifeonplus.com/">www.lifeonplus.com</a></p>\r\n<p>+91-9986-88-0000</p>', 'flash_news/flashnews6.jpeg', '2022-01-08 19:59:00', '2022-01-08 19:55:52', 1, '2022-04-25 17:24:31', 1, 1, 11, 1, 4, 1),
(16, 2, 'new', '', '<p>demo</p>', 'flash_news/flashnews2.jpg', '2020-01-21 13:20:20', '2022-01-09 10:06:06', 1, '2022-01-09 10:10:29', 1, -1, 11, 2, 32, 1),
(17, 1, 'LifeOn', '', '<p>Health is&nbsp;<strong>a state of complete physical, mental, and social well-being and not merely the absence of disease or infirmity</strong>.&rdquo;</p>', 'flash_news/flashnews3.jpg', '1970-01-01 05:30:00', '2022-01-28 12:32:53', 1, '0000-00-00 00:00:00', 0, 1, 11, 2, 29, 1),
