(1, 1, 'Medical Kit', '', 'Medical Kit', '', '2021-08-05 00:00:00', '0000-00-00 00:00:00', 0, '2021-08-05 19:28:22', 1, -1, 0, 0, 0, 0),
(2, 1, 'news', '', '<p>news</p>', 'flash_news/flashnews.png', '2021-08-12 12:04:00', '2021-08-05 16:11:00', 1, '2021-08-05 20:04:22', 1, -1, 0, 0, 0, 0),
(3, 1, 'tip1', '', '&lt;p&gt;x&lt;/p&gt;', '', '2021-08-12 12:04:01', '2021-08-05 16:25:15', 1, '2021-08-05 19:28:34', 1, -1, 0, 0, 0, 0),
(4, 1, 'jj', '', '&lt;p&gt;ihjioioi&lt;/p&gt;', '', '2021-08-12 12:04:01', '2021-08-05 16:44:50', 1, '2021-08-05 19:28:36', 1, -1, 0, 0, 0, 0),
(5, 1, 'xfcc', '', '<p>vcbvc</p>', 'health_tips/healthtips3.png', '2021-08-12 12:04:00', '2021-08-05 17:13:30', 1, '2021-08-31 10:14:05', 1, -1, 0, 0, 0, 0),
(6, 1, 'tipq', '', '<p>zxzxz</p>', 'health_tips/healthtips2.png', '2021-08-12 12:04:00', '2021-08-05 17:16:14', 1, '2021-08-31 10:14:01', 1, -1, 11, 1, 4, 1),
(7, 1, 'yuyuyuyuy', '', '<p>zxzxzxz</p>', 'health_tips/healthtips1.png', '2021-08-12 12:04:00', '2021-08-05 17:34:04', 1, '2021-08-31 10:13:57', 1, -1, 11, 1, 4, 1),
(8, 1, 'Eat a healthy diet', '', '<p style="text-align: left;">The start of a new decade brings with it new resolutions to improve one&rsquo;s life, including a healthier lifestyle. Here are 20 practical health tips to help you start off towards healthy living in 2020.</p>\r\n<p style="text-align: left;">Eat a combination of different foods, including fruit, vegetables, legumes, nuts and whole grains. Adults should eat at least five portions (400g) of fruit and vegetables per day. You can improve your intake of fruits and vegetables by always including veggies in your meal; eating fresh fruit and vegetables as snacks; eating a variety of fruits and vegetables; and eating them in season. By&nbsp;<a href="https://www.who.int/news-room/fact-sheets/detail/healthy-diet" target="_blank" rel="noopener">eating healthy</a>, you will reduce your risk of malnutrition and noncommunicable diseases (NCDs) such as diabetes, heart disease, stroke and cancer.</p>', 'health_tips/healthtips2.jpg', '2021-08-26 17:15:00', '2021-08-26 17:11:29', 1, '2021-08-27 10:37:46', 1, 1, 1, 78, 0, 0),
(9, 4, 'Consume less salt and sugar', '', '<p>Filipinos consume twice the recommended amount of sodium, putting them at risk of high blood pressure, which in turn increases the risk of heart disease and stroke. Most people get their sodium through salt. Reduce your salt intake to 5g per day, equivalent to about one teaspoon. It&rsquo;s easier to do this by limiting the amount of salt, soy sauce, fish sauce and other high-sodium condiments when preparing meals; removing salt, seasonings and condiments from your meal table; avoiding salty snacks; and choosing low-sodium products.<br /><br />On the other hand, consuming excessive amounts of sugars increases the risk of tooth decay and unhealthy weight gain. In both adults and children, the intake of free sugars should be reduced to less than 10% of total energy intake. This is equivalent to 50g or about 12 teaspoons for an adult. WHO recommends consuming less than 5% of total energy intake for additional health benefits. You can reduce your sugar intake by limiting the consumption of sugary snacks, candies and sugar-sweetened beverages.</p>', 'health_tips/healthtips3.jpg', '2021-08-31 22:30:00', '2021-08-31 10:34:19', 1, '0000-00-00 00:00:00', 0, 1, 11, 0, 0, 0),
(10, 5, 'Reduce intake of harmful fats', '', '<p>Fats consumed should be less than 30% of your total energy intake. This will help prevent unhealthy weight gain and NCDs. There are different types of fats, but unsaturated fats are preferable over saturated fats and trans-fats. WHO recommends reducing saturated fats to less than 10% of total energy intake; reducing trans-fats to less than 1% of total energy intake; and replacing both saturated fats and trans-fats to unsaturated fats.<br /><br />The preferable unsaturated fats are found in fish, avocado and nuts, and in sunflower, soybean, canola and olive oils; saturated fats are found in fatty meat, butter, palm and coconut oil, cream, cheese, ghee and lard; and trans-fats are found in baked and fried foods, and pre-packaged snacks and foods, such as frozen pizza, cookies, biscuits, and cooking oils and spreads.</p>', 'health_tips/healthtips4.jpg', '2021-08-30 11:00:00', '2021-08-31 10:36:18', 1, '0000-00-00 00:00:00', 0, 1, 11, 0, 0, 1),
(11, 3, 'Avoid harmful use of alcohol', '', '<p>There is no safe level for drinking&nbsp;<a href="https://www.who.int/news-room/fact-sheets/detail/alcohol" target="_blank" rel="noopener">alcohol</a>. Consuming alcohol can lead to health problems such as mental and behavioural disorders, including alcohol dependence, major NCDs such as liver cirrhosis, some cancers and heart diseases, as well as injuries resulting from violence and road clashes and collisions.</p>', 'health_tips/healthtips5.jpg', '2021-08-31 14:20:00', '2021-08-31 10:37:33', 1, '2021-08-31 15:55:09', 1, 1, 11, 1, 4, 1),
(12, 4, 'Test', '', '<p>Test</p>', 'health_tips/healthtips.png', '2021-09-07 16:53:00', '2021-09-07 16:53:27', 1, '0000-00-00 00:00:00', 0, 1, 11, 2, 29, 1),
