INSERT INTO `notifications` (`id`, `title`, `descr`, `date_time`, `image_path`, `created_at`, `created_by`, `updated_at`, `updated_by`, `status`, `notify`, `state_id`, `district_id`, `taluk_id`) VALUES
(1, 'Lifeonplus', '<p>Lifeonplus</p>', '2021-08-30 08:00:00', 'notify/flashnews3.jpg', '2021-08-25 11:09:19', 1, '2021-08-31 10:18:46', 1, -1, 1, 11, 1, 4),
(2, 'Overview of Comprehensive Full Body Checkup', '<div class="col-xs-12 style__packages-desc-wrapper___5oFgV">\r\n<h3 class="style__sub-header___36o04">How&nbsp;Comprehensive Full Body Checkup&nbsp;helps you?</h3>\r\n<div class="style__text___1Iyl0">It is well known that &lsquo;prevention is better than cure&rsquo; and this package is designed specifically for that purpose. It includes a unique diagnostic profile of tests for a comprehensive health evaluation at an early age. It screens the most common health conditions related to thyroid, heart, liver, kidney, bones and blood. Additionally, it also tests for vitamins like Vitamin B12 and Vitamin D. You should get this package done if you are above 30 years of age and want a thorough evaluation of the overall health status of your body.</div>\r\n</div>\r\n<div class="col-xs-12 style__precautions-wrapper___3pjgv">&nbsp;</div>', '0000-00-00 00:00:00', 'notify/flashnews.jpeg', '2021-08-31 10:22:57', 1, '0000-00-00 00:00:00', 0, 1, 1, 0, 0, 0),
(3, 'Eat a healthy diet', '<p>hdhhd</p>', '0000-00-00 00:00:00', '', '2021-08-31 14:12:34', 1, '0000-00-00 00:00:00', 0, 1, 0, 0, 0, 0),
(4, 'test app notify', '<p>test notify</p>\r\n<p>Testing 123</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '0000-00-00 00:00:00', 'notify/flashnews.pdf', '2021-08-31 14:47:03', 1, '2021-09-25 13:25:43', 1, 1, 1, 11, 1, 4),
(5, 'Test', '<p>Test</p>', '0000-00-00 00:00:00', 'notify/flashnews.jpeg', '2021-12-14 15:43:12', 1, '2021-12-15 22:59:10', 1, 1, 1, 11, 1, 4),
(6, 'Hi', '<p>Hello</p>', '0000-00-00 00:00:00', 'notify/flashnews1.jpeg', '2021-12-15 14:28:57', 1, '0000-00-00 00:00:00', 0, 1, 1, 11, 2, 29),
(7, 'Millions Took This Chinese Vaccine Against Covid. New Study Has Worrying Results.', '<p>The vaccine made by Sinovac Biotech Ltd., one of the most widely used in the world, doesn\'t provide sufficient antibodies to neutralize the omicron variant, said Hong Kong researchers in initial lab findings that may have sweeping consequences for the millions of people relying on the Chinese shot to protect them against Covid-19.</p>\r\n<p>Among a group of 25 people fully vaccinated with Sinovac\'s shot, which is called Coronavac, none showed sufficient antibodies in their blood serum to neutralize the omicron variant, said a statement from a team of researchers at the University of Hong Kong released late Tuesday night.</p>\r\n<p>In a separate group of 25 fully vaccinated with the messenger RNA shot developed by Pfizer Inc. and BioNTech SE, five had neutralizing ability against the new variant, the scientists said. That\'s in line with findings released last week by the companies, who said a third shot would be sufficient to protect against omicron.</p>\r\n<p>Led by Kwok-Yung Yuen, the highly respected professor in infectious diseases at the University of Hong Kong, the study of 50 people has been accepted for publication in the medical journal Clinical Infectious Diseases and is available online as a pre-print.</p>\r\n<p>While much is still unknown about how Sinovac\'s shot reacts to omicron -- including how T cells, the immune system\'s weapon against virus-infected cells, will respond -- the findings are a blow to those who have received the 2.3 billion doses of Coronavac shipped out, mostly in China and the developing world. With omicron seen to be at least four times as transmissible as the delta variant in a Japan study, the prospect of having to re-vaccinate against the new strain will set back the world\'s efforts to exit the pandemic.</p>\r\n<p>If Sinovac is found in more conclusive studies to be ineffective against omicron, China, which has managed to insulate the vast majority of its people from Covid-19 with closed borders and strict containment measures, faces the biggest threat from the new variant, said experts. The government has given out 2.6 billion homegrown shots -- many of them Coronavac -- to its population of 1.4 billion people, but now faces the prospect of having to develop new vaccines and rolling them out again before it can shift away from its current isolationist stance.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Natural Immunity</strong></p>\r\n<p>Among other countries using Coronavac, previous infection waves would have conferred some natural immunity that will help ensure "no major impact" from omicron, said Benjamin Cowling, a professor of epidemiology at the University of Hong Kong.</p>\r\n<p>But the populations in mainland China and Hong Kong have experienced no large-scale infection before, leaving them vulnerable.</p>', '0000-00-00 00:00:00', 'notify/flashnews.png', '2021-12-15 15:17:57', 1, '2022-04-25 17:25:39', 1, 1, 1, 11, 1, 4),
(8, 'Hangama', '<p>Welcome to Health Care</p>', '0000-00-00 00:00:00', 'notify/flashnews2.jpeg', '2021-12-15 22:57:37', 1, '2021-12-15 23:00:15', 1, 1, 1, 11, 1, 4),
(9, 'health', '<p>hi</p>', '0000-00-00 00:00:00', 'notify/flashnews.jpg', '2022-03-03 10:54:25', 1, '2022-04-25 16:25:08', 1, 1, 1, 11, 2, 30),
(10, 'This is test notify', '<p>This is test notify</p>', '0000-00-00 00:00:00', 'notify/flashnews1.jpg', '2022-04-25 16:19:35', 1, '2022-04-25 16:24:29', 1, -1, 1, 11, 2, 29),
(11, 'This is test notify', '<p>This is test notify</p>', '0000-00-00 00:00:00', 'notify/flashnews2.jpg', '2022-04-25 16:24:10', 1, '0000-00-00 00:00:00', 0, 1, 1, 11, 2, 29),
