INSERT INTO `popupalerts` (`id`, `title`, `descr`, `image_path`, `created_at`, `created_by`, `updated_at`, `updated_by`, `status`, `pid`) VALUES
(1, 'ddd', '<p>dd</p>', 'popupalerts/popupalerts10.jpg', '2022-05-02 18:10:23', 1, '2022-06-13 14:44:24', 1, -1, 1),
(2, 'World&#039;s Most Innovative Medical &amp; Digital Health Technological Products &amp; Services.. Medical Health Check-Up Camp', '<div class="detals_txt">\r\n<h4><span style="color: #000000;">Creating awareness about Health checkup through Health checkup camps in Pan India by Lifeonplus &amp; Its Associated Team.</span></h4>\r\n<p style="text-align: justify;">A&nbsp;<strong>health checkup camp</strong> is group of people undergoing for Tests at same time and place. To create awareness about Preventive Health checkup, we organize Health camp anywhere across India. The advantage of Health camp is that we provide service at confessional rates. The objective of Health camp is create awareness about Preventive Health check up. We have more than 4500 collection centers across India. We can arrange a camp at your place so all employees/members can undergo for Tests together on same day.</p>\r\n<h4><span style="color: #000000;">Requirements for Medical Test camp:</span></h4>\r\n<ul>\r\n<li>You need to confirm the&nbsp;<strong>Medical camp</strong> date and location, we require atleast 4 days prior intimation.</li>\r\n<li>&nbsp;</li>\r\n<li>We will inform the nearest Authorised Service Provider in your&nbsp; to attend the camp and give service.</li>\r\n<li>&nbsp;</li>\r\n<li>Blood samples of all members will be collected from same place.</li>\r\n<li>Reports will be given within 48 hours by email from the date of sample collection.</li>\r\n<li>&nbsp;</li>\r\n<li>If the medical tests are conduted by the DHS team, the reports would be given instantly.&nbsp;</li>\r\n<li>&nbsp;</li>\r\n</ul>\r\n<p><span style="color: #000000;"><strong>Complementry Medical Tests*:</strong></span></p>\r\n<p>These are subject to availability of medical devices at camps&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ( Members are requsted avail whenever these medical devices are present at the camps for free)</p>\r\n</div>\r\n<div id="frm" class="top-category-drop">&nbsp;</div>\r\n<div class="top-category-drop">Pls whatsapp +91-9986-88-0000 or info@lifeonplus.com for more info on Medical Tests</div>\r\n<div class="top-category-drop">&nbsp;</div>', 'popupalerts/popupalerts1.jpeg', '2022-05-05 11:44:54', 1, '2023-01-12 16:31:26', 1, 1, 1),
(3, 'Healthcare-Free Medical Tests', '<p>Hi</p>', 'popupalerts/popupalerts2.jpeg', '2022-06-18 15:38:19', 1, '2022-06-18 15:39:12', 1, -1, 0),
