(2, 2, 'Login OTP', '{#otp#} is your OTP to verify your login to Lifeon+. Please do not share this with anyone. Team Lifeon+. Regards, Paxykop Technologies', ''),
(3, 3, 'Password Reset', '', '<p>\n    Dear {#name#}, \n    <br> Your new login credentials Username is {#phone#} and Password is {#pass#} . \n    <br> Please do not share with anyone.\n</p>'),
