(8, 8, 'End User ', 'Dear Member, Thanks for your LIFEONPLUS subscription, your account is activated. Kindly download the \' LIFEONPLUS \' App from the link https://play.google.com/store/apps/details?id=com.paxykop.lifeonplus & login. If any queries please do revert on email info@lifeonplus.com. Team LIFEON+', ''),
(9, 9, 'Channel Partner', 'Welcome to Paxykop Technologies, Thanks for choosing {#var#} for LIFEON+ products. Your Channel Partner {#var#}{#var#}{#var#}. Any query please contact us on {#var#}{#var#}. Regards, Team LIFEON+\n', 'Welcome to Paxykop Technologies, Thanks for choosing {#var#} for LIFEON+ products. Your Channel Partner {#var#}{#var#}{#var#}. Any query please contact us on {#var#}{#var#}. Regards, Team LIFEON+\r\n'),
(10, 10, 'Pin credits', 'Acct {#no#} credited with {#package#} LIFEON+ Pins from {#cpartner#} Available Bal Pins {#pins#} Nos. Contact us on {#phone#}. Regards, Team LIFEON+.\n', 'Acct {#var#} has been credited with {#var#} life pins on {#var#} by {#var#}. Regards, Paxykop Technologies.\r\n'),
(11, 11, 'Pin Debit Pins', 'Acct {#no#} debited with {#package#} LIFEON+ Pins by transfer to {#transfer#} Available Bal Pins {#pins#} Nos. Contact us on {#phone#}. Regards, Team LIFEON+.', 'Acct {#no#} debited with {#package#} LIFEON+ Pins by creating end user on {#date#}. Available Bal Pins {#pins#} Nos. Contact us on {#phone#}. Regards, Team LIFEON+.');
